-- Quest Events (Example Helltide background Quest interfaces with this)
S_EVENT_WORLDBOSS_PING = "EVENT_WORLDBOSS_PING";
S_EVENT_WORLDBOSS_STARTED = "EVENT_WORLDBOSS_STARTED";
S_EVENT_WORLDBOSS_DONE = "EVENT_WORLDBOSS_DONE";

function EnableMaw(idPortal, idSkirt)
	if Hydra.ActorIsValid(idPortal) and Hydra.ActorIsValid(idSkirt) then
		Hydra.ActorEnable(idPortal);
		Hydra.ActorSetCollidable(idPortal, true);
		Hydra.ActorTriggerPowerAtTarget(idPortal, idPortal, POWER_SKIRTOPEN);
		Hydra.ActorTriggerPowerAtTarget(idPortal, idPortal, POWER_PORTALIDLE);
	end

	if Hydra.ActorIsValid(idSkirt) then
		Hydra.QActorAnim(idSkirt, POWER_SKIRTOPEN);
	end
end

function PlayMawSummoning(idPortal, idSkirt)
	if Hydra.ActorIsValid(idPortal) then
		Hydra.ActorTriggerPowerAtTarget(idPortal, idPortal, POWER_PORTALOPEN);
	end

	if Hydra.ActorIsValid(idSkirt) then
		Hydra.QActorAnim(idSkirt, POWER_SKIRTOPENING);
	end
end

function SpawnMaw(vPos)
	if not Is_Maw_Active then

		Is_Maw_Active = true

		if Hydra.ActorIsValid(Ref_Id_BossSpawn_MawSkirt) then
			Hydra.ActorDelete(Ref_Id_BossSpawn_MawSkirt);
		end
		
		if Hydra.ActorIsValid(Ref_Id_BossSpawn_MawPortal) then
			Hydra.ActorDelete(Ref_Id_BossSpawn_MawPortal);
		end
		
		local vMawPos = Hydra.PositionOffsetVertically(vPos,-0.075);
	
		Ref_Id_BossSpawn_MawPortal = Hydra.ActorSpawnActor(S_MAW_PORTAL_ACTOR, vMawPos, Ref_VMawFacing, false, 0, 0);
		Ref_Id_BossSpawn_MawSkirt = Hydra.ActorSpawnActor(S_MAW_SKIRT_ACTOR, vMawPos, Ref_VMawFacing, false, 0, 0);
	
		if Hydra.ActorIsValid(Ref_Id_BossSpawn_MawPortal) and Hydra.ActorIsValid(Ref_Id_BossSpawn_MawSkirt)then
			EnableMaw(Ref_Id_BossSpawn_MawPortal, Ref_Id_BossSpawn_MawSkirt);
		end
	end
end

function PlayMawClosing(idPortal, idSkirt)
	if Is_Maw_Active then
	
		-- Make sure we only Play Closing once
		Is_Maw_Active = false;

		-- Portal goes away
		if Hydra.ActorIsValid(idPortal) then
			-- Wait before killing portal, this is similar to the anim duration of the skirt escape anim
			Hydra.QActorWait(idPortal, 1.3);
			Hydra.QActorKill(idPortal);
		end
	
		-- Skirt goes away
		if Hydra.ActorIsValid(idSkirt) then
			Hydra.QActorAnim(idSkirt, POWER_MAW_ESCAPE);
			Hydra.QActorKill(idSkirt);
		end

	end
end

local function bossOutro()
	if Hydra.ActorIsValid(idFearZone) then
		Hydra.ActorDisable(idFearZone)
	end
	
	Hydra.Wait(.1)
	
	Hydra.QuestAdvancePhase()
	
	PlayMawClosing(Ref_Id_BossSpawn_MawPortal, Ref_Id_BossSpawn_MawSkirt)
	Hydra.Wait(5)
	Hydra.ClearWeatherOverride(strWorld)
	
	Hydra.Wait(15)
	Hydra.ClearMusicOverride(strWorld)
	
	-- For Quests interfacing with World Bosses such as Helltide to notify World Boss Event is done (killed or escape)
	-- With Wait so we do not enable some Quests such as Helltide during World Boss death and escape performance
	Hydra.EventSend(S_EVENT_WORLDBOSS_DONE)

end

